package baidumapsdk.demo.asmewill;import java.io.Serializable;import java.util.List;/** * Created by Administrator on 2017/6/14. */public class CityBean implements Serializable{    private List<CitysBean> citys;    public List<CitysBean> getCitys() {        return citys;    }    public void setCitys(List<CitysBean> citys) {        this.citys = citys;    }    public static class CitysBean implements Serializable{        /**         * mList : [{"cityname":"安国市"},{"cityname":" 阿尔山市"},{"cityname":" 鞍山市"},{"cityname":" 安达市"},{"cityname":" 安庆市"},{"cityname":" 安丘市"},{"cityname":" 安阳市"},{"cityname":" 安陆市"},{"cityname":" 安顺市"},{"cityname":" 安宁市"},{"cityname":" 安康市"},{"cityname":" 澳门特别行政区"},{"cityname":" 阿克苏市"},{"cityname":" 阿图什市"},{"cityname":" 阿拉山口市"},{"cityname":" 阿勒泰市"},{"cityname":" 阿拉尔市"}]         * title : A         */        private String title;        private List<MListBean> mList;        public String getTitle() {            return title;        }        public void setTitle(String title) {            this.title = title;        }        public List<MListBean> getMList() {            return mList;        }        public void setMList(List<MListBean> mList) {            this.mList = mList;        }        public static class MListBean implements Serializable{            /**             * cityname : 安国市             */            private String cityname;            public String getCityname() {                return cityname;            }            public void setCityname(String cityname) {                this.cityname = cityname;            }        }    }}